fn main() {
    assert_eq!(
        Solution::min_window("ADOBECODEBANC".to_string(), "ABC".to_string()),
        "BANC".to_string()
    );
    assert_eq!(
        Solution::min_window("a".to_string(), "a".to_string()),
        "a".to_string()
    );
    assert_eq!(
        Solution::min_window("a".to_string(), "aa".to_string()),
        "".to_string()
    );
    assert_eq!(
        Solution::min_window("bdab".to_string(), "ab".to_string()),
        "ab".to_string()
    );
    assert_eq!(
        Solution::min_window("".to_string(),
        "".to_string()),
        "".to_string()
    );
}

pub struct Solution {}
use std::collections::HashMap;
// https://www.youtube.com/watch?v=nMaKzLWceFg
impl Solution {
    pub fn min_window(s: String, t: String) -> String {
        if s.as_str().chars().count() == 0
            || s.as_str().chars().count() < t.as_str().chars().count()
        {
            return "".to_string();
        }
        let mut map: HashMap<char, i32> = HashMap::new();
        for c in t.as_str().chars() {
            let v = map.entry(c).or_insert(0);
            *v += 1;
        }

        let mut count = 0;
        let mut start = 0;
        let mut min_length: Option<usize> = None;
        let mut min_left = 0;

        for i in 0..s.as_str().chars().count() {
            if let Some(c) = s.as_str().chars().nth(i) {
                if let Some(v) = map.get_mut(&c) {
                    *v -= 1;
                }
                if map.get(&c) >= Some(&0) {
                    count += 1;
                }

                while count == t.as_str().chars().count() {
                    if let Some(length) = min_length {
                        if length > i - start + 1 {
                            min_length = Some(i - start + 1);
                            min_left = start;
                        }
                    } else {
                        min_length = Some(i - start + 1);
                        min_left = start;
                    }

                    if let Some(key) = s.as_str().chars().nth(start) {
                        if let Some(v) = map.get_mut(&key) {
                            *v += 1;
                            if v > &mut 0 {
                                count -= 1;
                            }
                        }
                    }

                    start += 1;
                }
            }
        }

        if let Some(length) = min_length {
            return (&s[min_left..(min_left + length)]).to_string();
        }

        return "".to_string();
    }
}
